// src/ui/strings.ts
export const STRINGS = {
  copiedToClipboard: 'Copied to clipboard',
  savedChanges:      'Saved changes',
  cacheCleared:      'Cache cleared',
  deleted: (name: string) => `Deleted “${name}”`,
};
